let chromaSharp = ['C', 'Db', 'D', 'Eb', 'E', 'F', 'Gb', 'G', 'Ab', 'A', 'Bb', 'B']

function chromaSharpNormalization(note) {
    switch (note) {
        case 'C#':
            return 'Db'
        case 'D#':
            return 'Eb'
        case 'F#':
            return 'Gb'
        case 'G#':
            return 'Ab'
        case 'A#':
            return "Bb"
    }

    return note
}

function mod(arr, num, index) {
    let sum = index + num
    if (sum >= arr.length)
        return arr[sum % arr.length]
    else if (sum < 0) {
        sum = sum + arr.length
        return arr[sum]
    }
    return arr[sum]
}


